body {
    background-color: #2e3440;
    margin: 0;
    padding: 0;
    font-family: 'Inter', sans-serif;
    font-style: normal;
    background-color: #2e3440;
    color: #d8dee9;
}

.container {
    display: grid;
    place-items: center;
}

h1 {
    font-size: 3rem;
    font-weight: 300;
    text-align: center;
}

hr {
    width: 45rem;
}

.grid {
    display: grid;
    margin: auto;
    padding: 5rem 2rem;
    grid-column-gap: 4.5rem;
    grid-row-gap: 4rem;
    grid-template-columns: 14rem 14rem 14rem;
}

.icon {
    border: 0.1rem solid #d8dee9;
    padding-top: 1rem;
    padding-bottom: 1rem;
    padding-left: 2rem;
    padding-right: 0.3rem;
    max-width: 10rem;
    border-radius: 0.5rem;
    cursor: pointer;
}

.icon:hover {
    background-color: #3b4252;
}
